import React, { Component } from 'react';
import { Button, Form, Grid,  Segment, Input, Radio } from 'semantic-ui-react'
import './index.css';

export default class SignUp extends Component {

  constructor() {
    super();

  }

  render(){
    return(
      <form class="ui form"><div class="equal width fields"><div class="field"><label>First name</label><div class="ui input"><input type="text" placeholder="First name"/></div></div><div class="field"><label>Last name</label><div class="ui input"><input type="text" placeholder="Last name"/></div></div><div class="field"><label>Gender</label><div role="listbox" aria-expanded="false" class="ui selection dropdown" tabindex="0"><div class="default text" role="alert" aria-live="polite">Gender</div><i aria-hidden="true" class="dropdown icon"></i><div class="menu transition"><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="true" class="selected item"><span class="text">Male</span></div><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="false" class="item"><span class="text">Female</span></div></div></div></div></div><div class="inline fields"><label>Quantity</label><div class="field"><div class="ui radio checkbox"><input type="radio" class="hidden" readonly="" tabindex="0" value="1"/><label>One</label></div></div><div class="field"><div class="ui radio checkbox"><input type="radio" class="hidden" readonly="" tabindex="0" value="2"/><label>Two</label></div></div><div class="field"><div class="ui radio checkbox"><input type="radio" class="hidden" readonly="" tabindex="0" value="3"/><label>Three</label></div></div></div><div class="field"><label>About</label><textarea placeholder="Tell us more about you..." rows="3" style="resize:"></textarea></div><div class="field"><div class="ui checkbox"><input type="checkbox" class="hidden" readonly="" tabindex="0"/><label>I agree to the Terms and Conditions</label></div></div><div class="field"><button class="ui button">Submit</button></div></form>
    );
  }
}
